import React from 'react';



type ButtonComponentType = {
    name: string;
    started: () => void;
    disabled?: boolean;
}


const ButtonStyle = {
    color: 'blue',
    height: '30px',
    width: '50px',
    borderRadius: '8px',
    fontFamily: "Monotype Corsiva",
    fontSize: '20px',
    fontStyle: 'italic',
    marginTop:'20px'
}

export const ButtonComponent = (props:ButtonComponentType) => {


    return (
        <span>
         <button style={ButtonStyle} onClick={props.started} disabled={props.disabled} >
             {props.name}
         </button>
        </span>
    );
};
